import axios from "axios";
import { Button, TableCell, TableRow } from "@material-ui/core";
import { Book } from "./book";
import Cookies from "js-cookie";
import React,{ useState, useEffect } from "react";

export interface BookTableRowProps {
  book: Book;
  isLoggedIn: boolean;
  handleBorrow: (bookId: number) => Promise<void>;
  user: any;
}

export function BookTableRow({ book, isLoggedIn, handleBorrow, user }: BookTableRowProps) {
  const [isBorrowed, setIsBorrowed] = useState(false);

  useEffect(() => {
    console.log("mmmmm:",user.books)
    if (user && user.data && user.data.books.includes(book.id)) {
      setIsBorrowed(true);
    }
    console.log("mmmmm:",isBorrowed)

  }, [book.id, user]);

  const borrowBook = async () => {
    // Get the user ID from the cookie
    const userId = Cookies.get("userId");
    if (!userId) {
      alert("Please log in to borrow books.");
      return;
    }
    // Send a GET request to fetch the user's borrowed books
    try {
      const response = await axios.get(`http://localhost:4000/api/v1/users/${userId}`);
      const userBooks = response.data.books;
      if (userBooks.length >= 3) {
        alert(`You cannot borrow more than 3 books. You have already borrowed ${userBooks.length} books.`);
        return;
      }
      // Send a PATCH request to update the user's borrowed books
      const response2 = await axios.patch(`http://localhost:4000/api/v1/users/${userId}`, {
        books: [...userBooks, book.id],
      });   
      alert(`Book "${book.book_name}" borrowed successfully!`);
      setIsBorrowed(true);
    } catch (error) {
      console.error(error);
      alert(`Failed to borrow book "${book.book_name}".`);
    }
  };

  return (
    <TableRow>
      <TableCell>{book.book_name}</TableCell>
      <TableCell>{book.author}</TableCell>
      {isLoggedIn && <TableCell>{book.copies}</TableCell>}
      <TableCell>{book.is_available ? "Available" : "Unavailable"}</TableCell>
      {isLoggedIn && (
        <TableCell>
          {isBorrowed ? (
            <Button variant="contained" color="secondary" disabled>
              Borrowed
            </Button>
          ) : (
            <Button variant="contained" color="primary" onClick={() => handleBorrow(book.id)} disabled={!book.is_available}>
              Borrow
            </Button>
          )}
        </TableCell>
      )}
    </TableRow>
  );
}
